import React from 'react';
import styles from './SignIn.module.css';


const SignIn = () =>{
    return(
        <>
       <div className={`${styles.signinHead}`}>
       <div className={`${styles.signinContent}`}>

        <h3>Sign In</h3>
       </div>
       </div>
        </>
    )
}

export default SignIn
